            <div data-content-for="xl">
              <p style="font-size: 2.94444rem; line-height: 3rem;" data-mce-style="font-size: 2.94444rem; line-height: 3rem;">
                <span class="font_rut3oe4qq">&nbsp;A Product Manager — </span><span class="font_rut3oe4qq">passionate  about technology, photography, art and how they shape our human experience</span></p></div><div data-content-for="xs"><p style="font-size: 1.72222rem; line-height: 2.11111rem;" data-mce-style="font-size: 1.72222rem; line-height: 2.11111rem;"><span class="font_rut3oe4qq">A designer and product leader — passionate about technology, art, and how they shape our human experience.</span></p></div></div>
				</div>

					</div>
				</div></div>
      </main>
    </div>
  );
}

export default Content;
